import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";


function App() {
    return <div>
        <Header></Header>
        {notes.map(notes =>
            <Note
                title={notes.title}
                content={notes.content}
                key={notes.id}>
                    <button>DELETE</button>
            </Note>)}
        <Footer></Footer>
    </div>
}

export default App;
